import React from 'react';
import {
  MDBCarousel,
  MDBCarouselItem,
} from 'mdb-react-ui-kit';

export default function Home() {
  return (
    <div>
    <MDBCarousel showIndicators showControls fade>
      <MDBCarouselItem
        className='w-100d-block'
        itemId={1}
        src='https://image.cnbcfm.com/api/v1/image/105922783-1558361451736908belairroad136.jpg?v=1558373951&w=1600&h=900'
        alt='...'
      >
      </MDBCarouselItem>

      <MDBCarouselItem
        className='w-100 d-block'
        itemId={2}
        src='https://image-cdn.carrot.com/uploads/sites/69435/2023/01/hd-wallpaper-g871b7a599_1920-1920x800.jpg'
        alt='...'
      >
        <h5>Second slide label</h5>
        <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit.</p>
      </MDBCarouselItem>

      <MDBCarouselItem
        className='w-100 d-block'
        itemId={3}
        src='https://cdn.wallpapersafari.com/26/26/EaBdGn.jpg'
        alt='...'
      >

      </MDBCarouselItem>
    </MDBCarousel>
    <h1>hahahah</h1>
    </div>
  );
}
